                    aptent nibh habitasse pulvinar nostra dolor. Hac, vivamus
                    metus imperdiet ultrices mollis sollicitudin sagittis. Quis
                    tortor augue, orci malesuada dui rutrum consequat turpis
                    ultrices. Per arcu nascetur etiam nascetur adipiscing.
                    Parturient ullamcorper tincidunt eu porta egestas nullam
                    convallis lectus sapien consectetur placerat. Aliquet,
                    viverra nullam tempor nisi tortor. Maecenas arcu, tortor
                    ante. Natoque turpis dui aenean sed. Nisi lectus dolor
                    himenaeos senectus tempus amet facilisi.
                  </p>
                </Col>
                <Col xs={3}>
                  <UserCard
                    bgImage="https://ununsplash.imgix.net/photo-1431578500526-4d9613015464?fit=crop&fm=jpg&h=300&q=75&w=400"
                    avatar={avatar}
                    name="Mike Andrew"
                    userName="michael24"
                    description={
                      <span>
                        "Lamborghini Mercy
                        <br />
                        Your chick she so thirsty
                        <br />
                        I'm in that two seat Lambo"
                      </span>
                    }
                  />
                  <MaterialButton
                    variant="contained"
                    color="success"
                    // type="submit"
                    size="large"
                    style={{ marginRight: 5 }}
                  >
                    Close
                  </MaterialButton>
                </Col>
              </Row>
            }
          />
        </Grid>
      </ShowPopUp>
      <div className="content">
        <Grid fluid style={{ margin: 0, padding: 0 }}>
          <CardNoFooter
            titlet="Account list"
            content={
              <Row>
                <Col xs={12}>
                  <NormalTable
                    headCells={materialHeader}
                    bodyData={materialBody}
                    notShowing={[variable.islock]}
                    actionbuttonlist={["read"]}
                  />
                </Col>
              </Row>
            }
          />
        </Grid>
      </div>
    </React.Fragment>
  );
}

export default Post;
